from typing import List
from collections import deque

class Solution:
    def nearestExit(self, maze: List[List[str]], entrance: List[int]) -> int:
        queue = deque([(0, entrance)])
        height, width = len(maze), len(maze[0])
        maze[entrance[0]][entrance[1]] = 'x'

        while queue:
            step, curr = queue.popleft()

            found = False

            # Up
            if curr[0] > 0:
                found = takeStep(maze, queue, step, curr[0] - 1, curr[1])
            if found:
                return step + 1

            # Down
            if curr[0] < height - 1:
                found = takeStep(maze, queue, step, curr[0] + 1, curr[1])
            if found:
                return step + 1

            # Left
            if curr[1] > 0:
                found = takeStep(maze, queue, step, curr[0], curr[1] - 1)
            if found:
                return step + 1

            # Right
            if curr[1] < width - 1:
                found = takeStep(maze, queue, step, curr[0], curr[1] + 1)
            if found:
                return step + 1

        return -1

def takeStep(maze, queue, step, y, x):
    height, width = len(maze), len(maze[0])
    if maze[y][x] != '.':
        return False

    if y == 0 or y == height - 1 or x == 0 or x == width - 1:
        return True

    maze[y][x] = 'x'
    queue.append((step + 1, [y, x]))
    return False

